create table monsters_templates
(
    Id                        int          not null
        primary key,
    Name                      varchar(255) null,
    Race                      varchar(255) null,
    NameId                    int unsigned not null,
    GfxId                     int unsigned not null,
    RaceId                    int          not null,
    MinDroppedKamas           int          not null,
    MaxDroppedKamas           int          not null,
    LookAsString              mediumtext   not null,
    UseSummonSlot             tinyint      not null,
    UseBombSlot               tinyint      not null,
    CanPlay                   tinyint      not null,
    CanTackle                 tinyint      not null,
    CanSwitchPos              tinyint      not null,
    CanBePushed               tinyint      not null,
    IsBoss                    tinyint      not null,
    IsActive                  tinyint      not null,
    AllIdolsDisabled          tinyint      not null,
    IncompatibleChallengesCSV mediumtext   null,
    canBeCarried              tinyint      null
)
    engine = MyISAM
    charset = utf8;

create index Id
    on monsters_templates (Id);

create index MonsterName
    on monsters_templates (Name);

